  DECLARE cre INT DEFAULT 0;
	SELECT
			`subject`.credit INTO cre 
		FROM
			`subject` 
		WHERE
			`subject`.subjectID = NEW.subjectID;
			
	IF( OLD.total_score is not null AND NEW.total_score is not null ) THEN			
		UPDATE student 
		SET student.GPA = (( student.GPA * student.TCTL ) + cre * NEW.total_score - cre* ODL.total_score)/(student.TCTL);

	ELSEIF(	OLD.total_score is null AND NEW.total_score is not null) THEN
		UPDATE student 
		SET student.GPA = (( student.GPA * student.TCTL ) + cre * NEW.total_score )/(student.TCTL + cre ),
			TCTL = TCTL + cre;
		ELSEIF ( OLD.total_score is not null AND NEW.total_score is null ) THEN
		SIGNAL SQLSTATE "45000" 
		SET MESSAGE_TEXT = "LỖI";
	END IF;
END
$$
